import React, {Fragment} from 'react';
import Navigation from './Navigation';


const Programmation = () => {
    return(
        <Fragment>
            <Navigation />
            <from>
            <select>1</select>
            <select>2</select>
            <select></select>
            <select></select>
            </from>
        </Fragment>
    )
}

export default Programmation
